      //             <Social 
      //               icon={social.name}
      //               color={props.colorMode}/>
      //           </a>
      // )
    // })
  }

  return (
    <div className={`content-center ${props.container}`}>
      {socialsIcon()}
    </div>
  )
}

export default SocialIcons
